const getComputedCell = (row, column, originalRows, computedRows) => {
  computedRows[row] = {
    ...computedRows[row],
    [column]:
      eval(
        originalRows[row][column].replace(
          /'(.+?)'&'(.+?)'/g,
          (_, row, column) => {
            return (
              computedRows?.[row]?.[column] ??
              getComputedCell(row, column, originalRows, computedRows)
            );
          }
        )
      ) ?? 0,
  };

  return computedRows[incomingRow][incomingColumn];
};

export default getComputedCell;
